import React, { Component } from "react";
import styled from "styled-components";

const Container = styled.div`
    height: 80vh;
    background: #4581af;
    display: flex;
    justify-content: center;
    align-items: center;
`;

class WorkingAtAegis extends Component {
    render() {
        return (
            <Container>
                <h2 style={{textAlign: "center", color: "white", lineHeight: "60px"}}>Join Our Team to <br></br>Build the Future of Finance</h2>
            </Container>
        );
    }
}
export default WorkingAtAegis;
